import React from 'react'

const Imagen = (props) => {

  /*const { previewURL, likes, largeImageURL, tags, views } = this.props.imagenes;*/

  return (
    <div className="col-12 col-sm-6 col-md-4 col-lg-3 mb-4">
      <div className="card" >
        <img src={props.previewURL} alt={props.views} className="card-img-top" />

      </div>

    </div>
  )


}




export default Imagen;
